import React from "react";
import Header from "./Header";
import Footer from "./Footer";

const Body = () => <div style={{ backgroundColor: "#133" }}></div>;

function Home() {
  return (
    <div>
      <Header />
      <Body />
      <Footer />
    </div>
  );
}

export default Home;
